class Solution(object):
    def minInteger(self, num, k):
        """
        :type num: str
        :type k: int
        :rtype: str
        """

        def find(num, st, k):
            if st == len(num) - 1:
                return -1
            if k >= (len(num) - st - 1):
                last = len(num) - 1
            else:
                last = st + k
            minind = st
            while st <= last:
                if num[st] < num[minind]:
                    minind = st
                st += 1

            return minind

        num = list(num)
        st = 0
        ind = find(num, st, k)
        # -1两种状态 最小值
        while ind != -1 and k != 0:
            num.insert(st, num[ind])
            del num[ind + 1]
            k -= ind - st
            st += 1
            ind = find(num, st, k)
        return "".join(num)


class BIT:
    def __init__(self, n: int):
        self.n = n
        self.tree = [0] * (n + 1)

    @staticmethod
    def lowbit(x: int) -> int:
        return x & (-x)

    def update(self, x: int):
        while x <= self.n:
            self.tree[x] += 1
            x += BIT.lowbit(x)

    def query(self, x: int) -> int:
        ans = 0
        while x > 0:
            ans += self.tree[x]
            x -= BIT.lowbit(x)
        return ans

    def queryRange(self, x: int, y: int) -> int:
        return self.query(y) - self.query(x - 1)


class Solution:
    def minInteger(self, num: str, k: int) -> str:
        n = len(num)
        pos = [list() for _ in range(10)]
        for i in range(n - 1, -1, -1):
            pos[ord(num[i]) - ord('0')].append(i + 1)

        ans = ""
        bit = BIT(n)
        for i in range(1, n + 1):
            for j in range(10):
                if pos[j]:
                    behind = bit.queryRange(pos[j][-1] + 1, n)
                    dist = pos[j][-1] + behind - i
                    if dist <= k:
                        bit.update(pos[j][-1])
                        pos[j].pop()
                        ans += str(j)
                        k -= dist
                        break

        return ans




